import React from 'react';
import './MoneyTransfer.css'; // Add your CSS styles

// Importing icons
import scanIcon from '../../assets/icons/scan-icon.png';
import mobileIcon from '../../assets/icons/mobile-icon.png';
import bankIcon from '../../assets/icons/bank-icon.png';
import selfIcon from '../../assets/icons/self-icon.png';
import historyIcon from '../../assets/icons/history-icon.png';
import splitIcon from '../../assets/icons/split-icon.png';
import receiveIcon from '../../assets/icons/receive-icon.png';

const MoneyTransfer = () => {
  return (
    <div className="money-transfer-container">
      {/* Header */}
      <div className="header">
        <h1>Money Transfer</h1>
      </div>

      {/* Money Transfer Section */}
      <div className="money-transfer-section">
        <div className="transfer-icons">
          <div className="icon">
            <img src={scanIcon} alt="Scan & Pay" />
            <p>Scan & Pay</p>
          </div>
          <div className="icon">
            <img src={mobileIcon} alt="To Mobile or Contact" />
            <p>To Mobile or Contact</p>
          </div>
          <div className="icon">
            <img src={bankIcon} alt="To Bank A/c or UPI ID" />
            <p>To Bank A/c or UPI ID</p>
          </div>
          <div className="icon">
            <img src={selfIcon} alt="To Self A/c" />
            <p>To Self A/c</p>
          </div>
          <div className="icon">
            <img src={historyIcon} alt="Balance & History" />
            <p>Balance & History</p>
          </div>
          <div className="icon">
            <img src={splitIcon} alt="Split Bills" />
            <p>Split Bills</p>
          </div>
          <div className="icon">
            <img src={receiveIcon} alt="Receive Money" />
            <p>Receive Money</p>
          </div>
        </div>
      </div>

      {/* Footer Navigation */}
      <div className="footer-navigation">
        <div className="nav-item">Track Expenses</div>
        <div className="nav-item">Home</div>
        <div className="nav-item">Loans</div>
      </div>
    </div>
  );
};

export default MoneyTransfer;
